import React from 'react';
import { Navigate, Outlet, useLocation } from 'react-router-dom';

const PrivateRoutes = ({ user }) => {
  const location = useLocation()

  return user ? <Outlet /> : <Navigate to="/login?next" />; 
};

export default PrivateRoutes;
